import React from 'react'

const Home = () => {
  return (
    <div className='mt-5'>
        <div className='container'>
            <div className='add_btn mt-2'>
                <button className='btn btn-primar'>Add Data</button>
            </div>
        </div>
    </div>
  )
}

export default Home
